import React from "react";
import "./SongResults.css";

function SongResults({ songs, clicked }) {
  console.log(clicked);
  return (
    <div className="result-content" onClick={clicked()}>
      <p>
        {songs.data.name} - {songs.data.artists.items[0].profile.name}
      </p>
      <img
        src={songs.data.albumOfTrack.coverArt.sources[0].url}
        alt=""
        className="Search-cover-art"
      />
      <button className="add-search-btn">+</button>
    </div>
  );
}

export default SongResults;
